import React from 'react';
import './App.css';
import './bootstrap.min.css';


class teambuilding extends React.Component{
	constructor(props){
		super(props);
		this.state = {
			pokemon : []
		}
	}
	render(){
		return(
			<div>
				<div class="container">
					<row>
						<div class="col-md-12">
							<header class="header">Eleements header</header>
						</div>
					</row>
				</div>
			</div>
		)
	}	
}

export default teambuilding;
